        "Desc": "Un trophe obtenu en vainquant Signora, la 8e Excutrice des Fatui.<br>Les membres de Fatui vivent souvent leurs vies  travers leurs masques. Aprs avoir rejoint l'organisation, ils doivent abandonner leur pass et leur individualit, renonant ainsi  leurs noms et  leurs visages.<br><br>Cependant, ces actions restent difficiles  accomplir.<br>Seuls ceux qui portent en eux une obsession qui frle ou transcende le dlire sont disposs  rejoindre cette organisation qui dfie l'ordre divin, laissant un il malfique consumer les jours qu'ils leur restent dans ce monde en change d'un immense pouvoir.<br>videmment, cela n'exclut pas la prsence de personnes ayant soif de pouvoir ou qui aiment tout simplement faire du mal  autrui chez les Fatui.<br><br>Rosalyne-Kruzchka Lohefalter mena jadis une vie simple et innocente.<br>Cependant, cette dernire prit fin lorsque ses yeux se remplirent d'une rage folle. La glace froide de son il malfique teignit les flammes qui la dvoraient, mais celles-ci resurgirent lorsqu'une trangre ternelle  la volont aussi inbranlable que la sienne brisa le pouvoir du froid qui la protgeait...",
