        "Desc": "Une brindille qui a t extraite du centre du monde.<br>Elle faisait partie d'un arbre gant dont les racines s'tendaient dans le monde entier. Bien qu'elle ait t arrache de celui-ci, leur lien demeure aussi fort qu'autrefois. Tant que l'arbre blanc gant qui symbolise le centre de ce monde ne dprit pas, cette brindille conservera sa vitalit.<br><br>Les arbres symbolisent la vie. Une histoire raconte que quelqu'un a confi sa conscience aux branches de l'arbre blanc avant son trpas pour que sa vie et ses espoirs ne soient pas perdus : les branches pousseraient et bourgeonneraient avec le soleil et la pluie pour finalement porter de nouveaux fruits.<br>Les arbres symbolisent galement la sagesse. Une lgende raconte qu'un sage suspendu  l'envers  un arbre avait obtenu le savoir ncessaire pour crire des runes et contrler les mots sacrs. En parcourant le royaume qui se trouvait le long des racines, il a pu entrevoir le secret du cosmos.<br>L'ensemble des connaissances, tous souvenirs et expriences du monde circulent  travers les racines du grand arbre, comme des ruisseaux qui convergent pour former une rivire qui se jette dans la mer et dont l'eau tombe des nuages. Ce cycle est celui de la vie.",
