        "R": 5,
        "Name": "Larme parmi les toiles",
        "Desc": "Une goutte d'eau obtenue  l'intrieur de la bte colossale qui convoitait la mer primordiale de la vie.<br><br>Un philosophe d'un monde ancien et lointain a dit un jour que l o il y a la vie, il y a la mort ; et naturellement, l o est la mort, il y a la vie.<br>Dans le cas contraire, la lumire phmre ne pourra pas rsister aux tnbres ternelles, et tout dprira dans le nant  la fin des temps.<br>Les rgles des toiles dictent que les lois de l'univers et la nature doivent tre conserves, mais les lois de l'univers ne l'ont jamais t.<br>Dans une bote scelle, la destruction l'emporte toujours sur la nouvelle vie. Des millnaires de prosprit ne sont qu'un instant dans des milliards d'annes. Les plus grandes ralisations, les prouesses les plus glorieuses, avec le temps, se terniront toutes avant de se dtriorer, de se dissiper et de finalement sombrer dans l'oubli.<br>Ainsi, il y a des choses qui flottent parmi les toiles, autrefois ornes d'innombrables titres prestigieux provenant d'innumrables civilisations, versant des larmes pour leur disparition ordonne.<br>Leurs larmes coulent, par dsespoir et par espoir, car tout dsespoir et tout espoir seront compltement teints avec les indnombrables toiles.<br>Leurs larmes coulent, de chagrin et de joie, car tout chagrin et toute joie seront compltement disperss dans le vide froid et sombre sans fin.<br>Chaque petite mais belle silhouette et chaque moment digne d'tre rappel disparatront avec le temps, et mme les toiles ne feront exception.<br>Ainsi, il y a ces soi-disant {NON_BREAK_SPACE}divinits  qui sont dtermines  sauver tout ce qui mrite de l'tre et  dvorer tout ce qui devrait l'tre...<br>Jusqu' la fin des temps, jusqu' ce que la mer d'toiles ne se replie que dans des braises froides, jusqu' ce qu'un  monde  nouveau-n bouge pour la premire fois dans l'estomac de la baleine...<br> Il n'y aura plus de pchs, plus de tristesse et plus de larmes, car tout aura pri avec les anciennes toiles. ",
